import React, { Component } from 'react';

class Reports extends Component {
  render() {
    return (
                <div>
            		<medium className="text-danger" id="see-more" style="cursor:pointer;"><u>See more</u></medium>
            		<medium className="pull-right text-danger" id="view-all"><u>View all</u></medium>
                </div>
        	);
  }
}
export default Reports;
